import React from "react";

function FormBook() {
    return (
        <div>
            <form>
                <div>
                    <h1>Cadastrar livro</h1>
                </div>
                <div class="form-group">
                    <label for="bookName">Nome do livro:</label>
                    <input type="email" class="form-control" id="bookName" />
                </div>
            </form>
        </div>
    )
}

export default FormBook;
